        "import ta\n",
        "import mplfinance as mpf\n",
        "import matplotlib.pyplot as plt\n",
        "\n",
        "# Rebuild OHLC with volume\n",
        "ohlc_with_vol = df.resample(\"1T\", on=\"timestamp\").agg({\n",
        "    \"bidPrice\": [\"first\", \"max\", \"min\", \"last\"],\n",
        "    \"bidVolume\": \"sum\"\n",
        "})\n",
        "ohlc_with_vol.columns = [\"Open\", \"High\", \"Low\", \"Close\", \"Volume\"]\n",
        "ohlc_with_vol = ohlc_with_vol.dropna()\n",
        "\n",
        "# Calculate RSI\n",
        "ohlc_with_vol[\"RSI\"] = ta.momentum.RSIIndicator(\n",
        "    close=ohlc_with_vol[\"Close\"],\n",
        "    window=14\n",
        ").rsi()\n",
        "\n",
        "# Create figure with 2 rows\n",
        "fig = plt.figure(figsize=(12,8))\n",
        "\n",
        "# --- Top subplot: Candlestick chart ---\n",
