        "import numpy as np\n",
        "import pandas as pd\n",
        "\n",
        "# Build trade list from your existing signals on ohlc_with_vol\n",
        "trades = []\n",
        "position = 0\n",
        "entry_price = None\n",
        "\n",
        "for i in range(len(ohlc_with_vol)):\n",
        "    px = ohlc_with_vol[\"Close\"].iloc[i]\n",
        "    buy_sig  = not np.isnan(ohlc_with_vol[\"Buy\"].iloc[i])\n",
        "    sell_sig = not np.isnan(ohlc_with_vol[\"Sell\"].iloc[i])\n",
        "\n",
        "    if position == 0 and buy_sig:\n",
        "        position = 1\n",
        "        entry_price = px\n",
        "    elif position == 1 and sell_sig:\n",
        "        ret = px / entry_price - 1.0\n",
        "        trades.append(ret)\n",
        "        position = 0\n",
        "        entry_price = None\n",
        "\n",
        "trade_returns = np.array(trades, dtype=float)  # per-trade returns in decimal\n",
        "print(f\"Trades: {len(trade_returns)}, mean={trade_returns.mean():.6f}, std={trade_returns.std():.6f}\")"
