        "\n",
        "# --- Monte Carlo Simulation (final balances only) ---\n",
        "def simulate_paths(trade_returns, n_paths=5000, n_trades=200, initial_balance=10000, ruin_threshold=0.5):\n",
        "    final_eq = np.zeros(n_paths)\n",
        "    mdd = np.zeros(n_paths)\n",
        "    ruined = np.zeros(n_paths, dtype=bool)\n",
        "\n",
        "    for i in range(n_paths):\n",
        "        equity = initial_balance\n",
        "        peak = initial_balance\n",
        "        max_dd = 0.0\n",
        "        path = []\n",
        "\n",
        "        for t in range(n_trades):\n",
        "            r = np.random.choice(trade_returns)  # sample trade outcome\n",
        "            equity *= (1 + r)\n",
        "            path.append(equity)\n",
        "\n",
        "            peak = max(peak, equity)\n",
        "            dd = (peak - equity) / peak\n",
        "            max_dd = max(max_dd, dd)\n",
        "\n",
        "        final_eq[i] = equity\n",
        "        mdd[i] = max_dd\n",
        "        ruined[i] = (equity < initial_balance * ruin_threshold)\n",
        "\n",
        "    return final_eq, mdd, ruined\n",
        "\n",
        "\n",
        "# --- Example returns: EUR/USD daily ~0.1% mean, ~1% stdev ---\n",
        "trade_returns = np.random.normal(0.001, 0.01, 1000)\n",
        "\n",
        "# --- Run Monte Carlo ---\n",
        "final_eq, mdd, ruined = simulate_paths(trade_returns)\n",
